/**
 * Like object assign but directly creating a new object and only enumerable properties.
 */
declare function merge<T>(a: T): T;
declare function merge<T, U>(a: T, b: U): T & U;
declare function merge<T, U, V>(a: T, b: U, c: V): T & U & V;
declare function merge<T, U, V, W>(a: T, b: U, c: V, d: W): T & U & V & W;
export default merge;
